import React from 'react';

function Tournament({ tournament }) {
  return (
    <tr>
      <th colSpan="2">
        {tournament}
      </th>
    </tr>
  );
}

function TournamentTable({ tournaments }) {
  const rows = [];

  tournaments.forEach((tournament) => {
    rows.push(
      <Tournament
        tournament={tournament} />
    );
    lastCategory = product.category;
  });

  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Price</th>
        </tr>
      </thead>
      <tbody>{rows}</tbody>
    </table>
  );
}

const Home = () => {
  return (
    <div
      style={{
        margin: '5vh'
      }}
    >
      <h1>Willkommen auf Competico, der einzig wahren E-Sports-Turnier-Website</h1>

      <Tournament />
    </div>
  );
};
  
export default Home;
